#include <stdio.h>
#include <stdlib.h>

#define MAXN 100005

int n;
int a[MAXN], b[MAXN];
int adj[MAXN];
int color[MAXN];

void dfs(int u, int p) {
    for (int v = adj[u]; v; v = adj[u]) {
        int w = adj[v];
        if (w == p) {
            adj[v] = adj[v] ^ v;
            adj[u] = adj[u] ^ v;
            continue;
        }
        color[w] = (color[u] == 1) ? 2 : 1;
        dfs(w, u);
    }
}

int main() {
    scanf("%d", &n);
    for (int i = 1; i < n; i++) {
        scanf("%d %d", &a[i], &b[i]);
        adj[a[i]] = adj[a[i]] | (1 << i);
        adj[b[i]] = adj[b[i]] | (1 << i);
    }
    color[1] = 1;
    dfs(1, 0);
    if (color[n] == 1) {
        printf("Fennec\n");
    } else {
        printf("Snuke\n");
    }
    return 0;
}
